    display: flex;
    justify-content: space-between;
`;

const Filter = styled.div`
    margin: 20px;
`;

const FilterText = styled.span`
    font-size: 20px;
    font-weight: 600;
`;

const Select = styled.select`

`;

const Option = styled.option`

`;
const ProductList = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Title>Flowers</Title>
        <FilterContainer>
            <Filter>
                <FilterText>Filter Flowers:</FilterText>
            </Filter>
            <Filter>
            <FilterText>Sort Flowers:</FilterText>
            </Filter>
        </FilterContainer>
        <Products/>
        <Newsletter/>
        <Footer/>
    </Container>
  )
}

export default ProductList
